import React from "react";
import styles from "./SingleMeal.module.css";

function SingleMeal(props) {
  return (
    <li className={styles["list-item"]} key={props.key}>
      <h1>{props.name}</h1>
      <div>{props.description}</div>
      <div>{props.price}</div>
    </li>
  );
}

export default SingleMeal;
